    privacy_agreement_tips:
      "ເພື່ອເພີ່ມປະສົບການຂອງທ່ານກັບ %@ ແລະຮັບປະກັນການໃຊ້ງານທີ່ປອດໄພ ແລະໝັ້ນຄົງຂອງແອັບຯຂອງພວກເຮົາ, ພວກເຮົາໄດ້ລວມເອົາຊຸດພັດທະນາຊອບແວພາກສ່ວນທີສາມ (SDK) ເພື່ອເປີດໃຊ້ງານບາງຢ່າງ. \\nໝັ້ນໃຈໄດ້ວ່າພວກເຮົາໃຫ້ຄວາມສຳຄັນກັບຄວາມປອດໄພຂໍ້ມູນຂອງທ່ານ ແລະເຮັດການທົດສອບຢ່າງເຂັ້ມງວດໃນ SDK. ພວກ​ເຮົາ​ຈະ​ບໍ່​ເກັບ​ກໍາ​ຂໍ້​ມູນ​ໃນ​ລັກ​ສະ​ນະ​ການ​ບີບ​ບັງ​ຄັບ​ຫຼື​ຢ່າງ​ດຽວ​ໂດຍ​ອີງ​ໃສ່​ການ​ຕົກ​ລົງ​ຂອງ​ທ່ານ​ກັບ​ນະ​ໂຍ​ບາຍ​ຄວາມ​ເປັນ​ສ່ວນ​ຕົວ​. \\nໂດຍການແຕະທີ່ປຸ່ມ, ທ່ານຕົກລົງຍອມຮັບການບໍລິການຂອງພວກເຮົາ.",
    privacy_agreement_tips_new:
      "ເພື່ອເພີ່ມປະສົບການຂອງທ່ານກັບ %@ ແລະຮັບປະກັນການໃຊ້ງານທີ່ປອດໄພ ແລະໝັ້ນຄົງຂອງແອັບຯຂອງພວກເຮົາ, ພວກເຮົາໄດ້ລວມເອົາຊຸດພັດທະນາຊອບແວພາກສ່ວນທີສາມ (SDK) ເພື່ອເປີດໃຊ້ງານບາງຢ່າງ. ໝັ້ນໃຈໄດ້ວ່າພວກເຮົາໃຫ້ຄວາມສຳຄັນກັບຄວາມປອດໄພຂໍ້ມູນຂອງທ່ານ ແລະ ດຳເນີນການທົດສອບຢ່າງເຂັ້ມງວດໃນ SDK. ພວກ​ເຮົາ​ຈະ​ບໍ່​ເກັບ​ກໍາ​ຂໍ້​ມູນ​ໃນ​ລັກ​ສະ​ນະ​ການ​ບີບ​ບັງ​ຄັບ​ຫຼື​ຢ່າງ​ດຽວ​ໂດຍ​ອີງ​ໃສ່​ການ​ຕົກ​ລົງ​ຂອງ​ທ່ານ​ກັບ​ນະ​ໂຍ​ບາຍ​ຄວາມ​ເປັນ​ສ່ວນ​ຕົວ​. ໂດຍການແຕະທີ່ປຸ່ມ, ທ່ານຕົກລົງຍອມຮັບການບໍລິການຂອງພວກເຮົາ.",
